import Nav from './components/Nav'
import Caroussel from './components/Caroussel'
import Form from './components/Form'
import Search from './components/Search'

import './App.css';


function App() {
  return (
    <div className="App">
      <Nav /> 
      <Caroussel />
      <Form />  
      <Search />   
    </div>
  );
}

export default App;
